import React from "react";
// import { Col, Row, Container } from "../components/Grid";


const Result = React.createClass({
  iframe: function () {
    return {
      __html: this.props.iframe
    }
  },

  render: function() {
    return (
      <div>
        <div dangerouslySetInnerHTML={ this.iframe() } />
      </div>
    );
  }
});

const iframe = '<iframe src="http://www.budgetyourtrip.com/widgets/countrycostwidget.php?width=300" frameborder="0" border="0" cellspacing="0" style="width: 300px; height: 300px; margin: 0; padding: 0; overflow: hidden; border: 0;"></iframe>'; 

ReactDOM.render(
  <Component iframe={iframe} />,
  document.getElementById('container')
);
const order = [
  'dQw4w9WgXcQ',
  'dMH0bHeiRNg',
  '9bZkp7q19f0'
];

const selectedId = '9bZkp7q19f0';

const rearrange = ( increment ) => () => {
  const index = order.indexOf( selectedId );
  const nextIndex = index + increment;
  if ( nextIndex < 0 || nextIndex >= order.length ) {
    return;
  }
  const selected = order[ index ];
  order.splice( index, 1 );
  order.splice( nextIndex, 0, selected );
  render();
};

function render() {
  ReactDOM.render(
    <div>
      <VideoList
        videos={ order }
        selectedId={ selectedId } />
      <div>
        <button type="button" onClick={ rearrange( -1 ) }>‹</button>
        <button type="button" onClick={ rearrange( 1 ) }>›</button>
      </div>
    </div>,
    document.getElementById( 'root' )
  );
}

render();

export default Result;
